import React from 'react';

function Resume() {
  return (
    <div className='items-center justify-center'>
         <div >
                <a href="objects/resume.pdf" attributes-list download> Download my resume!</a> 
                <embed src="objects/resume.pdf" width="70%" height="1000px" type="application/pdf"/>
            </div>
    </div>

  );
}

export default Resume;
